import './App.css';
import {BrowserRouter,Route,Routes,useHistory} from 'react-router-dom'
import Signup from './components/signup';
import Navbar from './components/navbar';

const Routing = ()=>{
  return (
    <Routes>
      <Route exact path="/signup" >
      <Signup />
      </Route>
      <Route exact path="/signin" >
      <Signup />
      </Route>
    </Routes>
  )
}

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routing />
    </BrowserRouter>
  );
}

export default App;
